                // followY = this.limiter.y + Utils.sign(this.limiter.y - followY) * (this.height / this.scale) * 0.4;

                // }


                followX = Utils.lerp(followX, this.limiter.x, 0.75);
                followY = Utils.lerp(followY, this.limiter.y, 0.75);

