    sprites: [
        [146, 2, 25, 31],
        [178, 5, 18, 25],
        [149, 36, 17, 26],
        [169, 37, 11, 18],
        [183, 33, 9, 33],
        [196, 33, 13, 33],
        [149, 69, 13, 20],
        [166, 70, 16, 18],
        [187, 68, 14, 22]
    ],

