        button.subtip = "Heal 1 HP for 1 food"

        this.guiElements.campfire = button;

        button.on(PLAYGROUND.MOBILE ? "dragstart" : "click", () => {

            this.action.set("place_campfire");

    });

        this.buttons.push(button);

        var button = this.gui.add("ActionButton");

