CLIENT.Game.fxSpark = function(object, type) {

    let spark = this.entities.add("Sprite");

    spark.x = object.x;
    spark.y = object.y;
    spark.set("spark/" + type)
    spark.duration = 0.5;

    this.manipulate(spark, CLIENT.Manipulators.follow, {
        follow: object
    });

};

